import React from 'react';
import personalInfo from '../personal/info.json';

const Links = () => {
  const { links } = personalInfo;

  return (
    <div>
      <p>
        <a href={links.linkedin} target="_blank" rel="noopener noreferrer">
          LinkedIn Profile
        </a>
      </p>
    </div>
  );
};

export default Links;
